Green Lantern Corps v2 #19
Publisher:  DC Comics
Publication Date:  December 12, 2007

Story and Words:  Peter J. Tomasi
Pencilers:  Patrick Gleason
Inkers:  Prentis Rollins, Derek Fridolfs, Tom Nguyen, Drew Geraci, Dan Davis, Rebecca Buchman
Colorist:  David Curiel, JD Smith, Guy Major
Letterer:  Phil Balsman
Cover by:  Patrick Gleason &amp; Prentis Rollins with Moose Bauman

The pieces of the Sinestro Corps War are still falling as Guy is finally reunited with his lost love, Ice! And as Kyle Rayner tries to start his new life as a Green Lantern, Sinestro rings continue to empower new and deadlier forces in space.

